    "i-claims",nt"isopen": true,nt"url": null,nt"notes": "The Internet
    Claims application (formerly known as Ready Retirement and the Internet Social Security
    Benefit Application (ISBA)) allows claimants to complete and submit applications
    for retirement, disability and aged spouse's benefits via the Internet. A part of
    the i-Claims processing includes establishing proof of age and proof of citizenship
    for applicants using SSA's main data stores (ICD, MBR, SSR and NUMIDENT). VSB is
    responsible for the NUMIDENT Utility Subprogram which compares the information submitted
    by the application to the data stored on the NUMIDENT to establish POA and POC.
    The utility also applies a tolerance for analyzing several data fields on the NUMIDENT
    in conjunction with each other to further improve the likelihood of establishing
    eligibility.",nt"license_title": "Other License Specified",nt"extras":
